sys_variable_value.value:
(function execute(inputs, outputs) {
  var q = new GlideRecord('x_fmcna_armis_inte_armis_integration_cache')
  q.addQuery('key',inputs.cache_key)
  q.query()
  if (q.getRowCount() > 0)
  {
    q.next()
    outputs.str = q.getValue('value_string')
    outputs.int = q.getValue('value_int')
    outputs.datetime = q.getValue('value_datetime')
  }
})(inputs, outputs);

